CREATE DATABASE SalesDB_New;
USE SalesDB_New;


CREATE TABLE ProductInformation (
    ProductID VARCHAR(10) PRIMARY KEY,
    ProductCategory VARCHAR(50),
    ProductName VARCHAR(100),
    Manufacturer VARCHAR(50),
    Price DECIMAL(10, 2)
);

CREATE TABLE SalesData (
    Country VARCHAR(50),
    Year INT,
    Month INT,
    ProductID VARCHAR(10),
    SalesAmount DECIMAL(10, 2),
    UnitsSold INT,
    SalesChannel VARCHAR(50),
    CustomerSegment VARCHAR(50),
    DiscountAmount DECIMAL(10, 2),
    Profit DECIMAL(10, 2),
    FOREIGN KEY (ProductID) REFERENCES ProductInformation(ProductID)
);
-- Inserting data into ProductInformation

-- Inserting data into SalesData

SELECT * FROM ProductInformation

SELECT * FROM SalesData

SELECT pi.ProductCategory, SUM(sd.SalesAmount) AS TotalSales
FROM SalesData sd
JOIN ProductInformation pi ON sd.ProductID = pi.ProductID
GROUP BY pi.ProductCategory;


SELECT Year, Month, SUM(SalesAmount) AS MonthlySales
FROM SalesData
WHERE Year = 2023
GROUP BY Year, Month
ORDER BY Month;


SELECT TOP 5 pi.ProductName, SUM(SalesData.SalesAmount) AS TotalSales
FROM SalesData
JOIN ProductInformation pi ON SalesData.ProductID = pi.ProductID
GROUP BY pi.ProductName
ORDER BY TotalSales DESC;

